const Crypto = require("crypto-js")
const aesKey = "46cc793c53dc451b"
function decryptRequest(t) {
  var e = Crypto.enc.Utf8.parse(aesKey)
    
  var i = Crypto.AES.decrypt(t, e, {
      mode: Crypto.mode.ECB,
      padding: Crypto.pad.Pkcs7
  });
  return Crypto.enc.Utf8.stringify(i).toString()
}

var enc = ""


console.log(decryptRequest(enc))

